function paintMbti(userName, userMbti){
    const upperMbti = userMbti.toUpperCase();
    for(var i=0;i<16;i++){
        if(upperMbti === human[i].mbti){
            var img = document.createElement('img');
            img.src = human[i].imgUrl;
            welcome.appendChild(img);
            spanMbti.innerText=`${userName}님의 mbti 는 '${upperMbti}' 입니다. 
                                ${userName}님과 비슷한 삼국지 인물은 '${human[i].name}' 입니다. 
                                ${userName}님은 '${human[i].description}'의 성향을 가졌습니다.
                                
                                
                                `;
            again.innerText=`다시 알아보기`;                    
        }
    }
}

function clickHandler(event){
    const userName = name.value;
    const userMbti = mbti.value;
    document.getElementById("box").style.display="none";
    paintMbti(userName, userMbti);
}
